// SPDX-License-Identifier: MIT
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/utils/math/SignedMath.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";

pragma solidity ^0.8.0;


contract DomainRegistry {
    mapping(string => string) public domainToAddresses;

    function registerDomain(string memory domain, address contractAddress, string memory roleName) public {
        string memory addresses = domainToAddresses[domain];
        if (bytes(addresses).length == 0) {
            addresses = string(abi.encodePacked(Strings.toHexString(uint256(uint160((msg.sender)))), ":", roleName, ":"));
        }
        addresses = string(abi.encodePacked(addresses, ":", Strings.toHexString(uint256(uint160((contractAddress))))));
        domainToAddresses[domain] = addresses;
    }

